script: |
  super -f text -I q10893.spq | sort > q10893.out

inputs:
  - name: q10893.spq
    data: |
      SELECT 83, - ( 44 ) AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - 5 * - col0 IN ( + - col0, col2 );
  - name: tab2

outputs:
  - name: q10893.out
    data: |
      83	-44
      83	-44
      83	-44
